    }

    function _transfer(
        address _token,
        address _receiver,
        uint256 _amount
    ) private {
        if (_token == 0x9A676e781A523b5d0C0e43731313A708CB607508) {
            // If _token is WBNB
            IWETH(_token).withdraw(_amount);
            payable(_receiver).transfer(_amount);
        } else {
            IERC20(_token).safeTransfer(_receiver, _amount);
        }
    }
